import json
import logging
import struct
from hexdump import hexdump

from gdt.jce_struct.types import JceDecoder


class M11JceDecode:
    def __init__(self):
        pass

    @staticmethod
    def get_test_data():
        data_hex = ''
        return bytearray.fromhex(data_hex)

    @staticmethod
    def get_data_length(data_bytes):
        head_4_len = data_bytes[:4]
        data_length = int.from_bytes(head_4_len, byteorder='big')
        return data_length, data_bytes[4:]

    @staticmethod
    def decode_jce(data_bytes):
        try:
            decoder = JceDecoder().decode_bytes(data_bytes)
            return decoder
        except Exception as e:
            logging.debug(e)
            return {}

    @staticmethod
    def bytes_to_str(byte_ori: bytes):
        try:
            number = struct.unpack('>B', byte_ori)[0]
            return number
        except Exception as e:
            logging.debug(e)
            return ''

    @staticmethod
    def decode_bytes(byte_ori: bytes):
        try:
            return byte_ori.decode()
        except Exception as e:
            logging.debug(e)
            return ''

    def decode_recursion(self, data: dict):
        result = {}
        for k, v in data.items():
            k = self.bytes_to_str(k) if isinstance(k, bytes) else k
            if isinstance(v, (str, int, float)):
                result[k] = v
                continue
            if isinstance(v, dict):
                result[k] = self.decode_recursion(v)
                continue
            if isinstance(v, bytes):
                str_v = self.bytes_to_str(v)
                if str_v != '':
                    result[k] = str_v
                    continue
                jce_value = self.decode_jce(v)
                result[k] = self.decode_recursion(jce_value)
                continue
            raise KeyError(f'key: {k}, value: {v}')
        return result

    def main(self):
        data_bytes = self.get_test_data()
        data_len, data_bytes = self.get_data_length(data_bytes)
        print('data_len:', data_len)
        data_json = self.decode_jce(data_bytes)
        if not data_json:
            raise Exception('data decode error')
        decode_value = self.decode_recursion(data_json)
        print(json.dumps(decode_value))

